variables.input:
timeseries {
  cpu_usage = sum(dt.kubernetes.container.cpu_usage)
}, filter: {
  k8s.cluster.name == $Cluster AND
  k8s.namespace.name == $Namespace
}, by: { k8s.workload.kind },
from: -2m
| summarize collectDistinct(k8s.workload.kind)
| fieldsAdd `collectDistinct(k8s.workload.kind)` = arraySort(`collectDistinct(k8s.workload.kind)`, direction: "ascending")

